import 'dart:convert';

class product {
  List<HeaderCategory>? headerCategory;
  List<MainCategory>? mainCategory;
  List<Popular>? popular;
  List<SeasonsTopPick>? seasonsTopPick;
  List<Sponsored>? sponsored;
  List<HealthWellness>? healthWellness;
  List<InDemand>? inDemand;
  List<WildestCollection>? wildestCollection;

  product(
      {this.headerCategory,
      this.mainCategory,
      this.popular,
      this.seasonsTopPick,
      this.sponsored,
      this.healthWellness,
      this.inDemand,
      this.wildestCollection});

  product.fromJson(Map<String, dynamic> json) {
    if (json['header-category'] != null) {
      headerCategory = <HeaderCategory>[];
      json['header-category'].forEach((v) {
        headerCategory!.add(new HeaderCategory.fromJson(v));
      });
    }
    if (json['main-category'] != null) {
      mainCategory = <MainCategory>[];
      json['main-category'].forEach((v) {
        mainCategory!.add(new MainCategory.fromJson(v));
      });
    }
    if (json['popular'] != null) {
      popular = <Popular>[];
      json['popular'].forEach((v) {
        popular!.add(new Popular.fromJson(v));
      });
    }
    if (json['seasons-top-pick'] != null) {
      seasonsTopPick = <SeasonsTopPick>[];
      json['seasons-top-pick'].forEach((v) {
        seasonsTopPick!.add(new SeasonsTopPick.fromJson(v));
      });
    }
    if (json['sponsored'] != null) {
      sponsored = <Sponsored>[];
      json['sponsored'].forEach((v) {
        sponsored!.add(new Sponsored.fromJson(v));
      });
    }
    if (json['Health-Wellness'] != null) {
      healthWellness = <HealthWellness>[];
      json['Health-Wellness'].forEach((v) {
        healthWellness!.add(new HealthWellness.fromJson(v));
      });
    }
    if (json['InDemand'] != null) {
      inDemand = <InDemand>[];
      json['InDemand'].forEach((v) {
        inDemand!.add(new InDemand.fromJson(v));
      });
    }
    if (json['wildest-collection'] != null) {
      wildestCollection = <WildestCollection>[];
      json['wildest-collection'].forEach((v) {
        wildestCollection!.add(new WildestCollection.fromJson(v));
      });
    }
  }

  Map<String, dynamic> toJson() {
    final Map<String, dynamic> data = new Map<String, dynamic>();
    if (this.headerCategory != null) {
      data['header-category'] =
          this.headerCategory!.map((v) => v.toJson()).toList();
    }
    if (this.mainCategory != null) {
      data['main-category'] =
          this.mainCategory!.map((v) => v.toJson()).toList();
    }
    if (this.popular != null) {
      data['popular'] = this.popular!.map((v) => v.toJson()).toList();
    }
    if (this.seasonsTopPick != null) {
      data['seasons-top-pick'] =
          this.seasonsTopPick!.map((v) => v.toJson()).toList();
    }
    if (this.sponsored != null) {
      data['sponsored'] = this.sponsored!.map((v) => v.toJson()).toList();
    }
    if (this.healthWellness != null) {
      data['Health-Wellness'] =
          this.healthWellness!.map((v) => v.toJson()).toList();
    }
    if (this.inDemand != null) {
      data['InDemand'] = this.inDemand!.map((v) => v.toJson()).toList();
    }
    if (this.wildestCollection != null) {
      data['wildest-collection'] =
          this.wildestCollection!.map((v) => v.toJson()).toList();
    }
    return data;
  }
}

class HeaderCategory {
  String? id;
  String? categoryName;
  String? imageUrl;

  HeaderCategory({this.id, this.categoryName, this.imageUrl});

  HeaderCategory.fromJson(Map<String, dynamic> json) {
    id = json['id'];
    categoryName = json['category-name'];
    imageUrl = json['image-Url'];
  }

  Map<String, dynamic> toJson() {
    final Map<String, dynamic> data = new Map<String, dynamic>();
    data['id'] = this.id;
    data['category-name'] = this.categoryName;
    data['image-Url'] = this.imageUrl;
    return data;
  }
}

