class MainCategory {
  String? id;
  String? categoryName;
  String? imageUrl;

  MainCategory({this.id, this.categoryName, this.imageUrl});

  factory MainCategory.(
      Map<String, dynamic> data) {
    return MainCategory(
      id: data['id'] as String?,
      categoryName: data['category-name'] as String?,
      imageUrl: data['image-Url'] as String?,
    );
  }

  Map<String, dynamic>
      () {
    return {
      'id': id,
      'category-name': categoryName,
      'image-Url': imageUrl,
    };
  }

  /// `dart:convert`
  ///
  /// Parses the string and returns the resulting Json object as [MainCategory].
  factory MainCategory.fromJson(String data) {
    return MainCategory
        .(
            json.decode(data) as Map<String, dynamic>);
  }

  /// `dart:convert`
  ///
  /// Converts [MainCategory] to a JSON string.
  String toJson() => json.encode(
      ());
}

